import React, { useState } from 'react'
import Charts from 'react-apexcharts'

const CardGraph = () => {
    const [Data] = useState(
        {
           options : {
               chart:{
                   type:'donut'
               },
                background:"fff",
                plotOptions: {
                    pie: {
                      customScale: 0.9,
                      donut: {
                        size: '65%',
                        background:'transparent',
                        labels:{
                            show:true,
                            name:{
                                show:true,
                                fontSize:"16px",
                                fontFamily:"Montserrat",
                                off
                            }
                        }
                      }
                    }
                }
           },
           series: [11,45,79],
        }
    )
    return (
        <div>
              <Charts options={Data.options} series={Data.series}  width="350" type='donut' />
        </div>
    )
}

export default CardGraph
